package main

import (
	"reflect"
	"testing"
)

func Test_duplicateZeros(t *testing.T) {
	type args struct {
		arr  []int
		want []int
	}
	type test struct {
		name string
		args args
	}
	arr1 := []int{1, 0, 2, 3, 0, 4, 5, 0}
	arr2 := []int{1, 2, 3}
	tests := []test{
		func() test {
			return test{
				args: args{
					arr:  arr1,
					want: []int{1, 0, 0, 2, 3, 0, 0, 4},
				},
			}
		}(),
		func() test {
			return test{
				args: args{
					arr:  arr2,
					want: []int{1, 2, 3},
				},
			}
		}(),
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			duplicateZeros(tt.args.arr)
			if !reflect.DeepEqual(tt.args.arr, tt.args.want) {
				t.Errorf("duplicateZeros = %v, want %v", tt.args.arr, tt.args.want)
			}
		})
	}
}

func Test_largestValsFromLabels(t *testing.T) {
	type args struct {
		values     []int
		labels     []int
		num_wanted int
		use_limit  int
	}
	tests := []struct {
		name string
		args args
		want int
	}{
		{
			args: args{
				values:     []int{5, 4, 3, 2, 1},
				labels:     []int{1, 1, 2, 2, 3},
				num_wanted: 3,
				use_limit:  1,
			},
			want: 9,
		},
		{
			args: args{
				values:     []int{5, 4, 3, 2, 1},
				labels:     []int{1, 3, 3, 3, 2},
				num_wanted: 3,
				use_limit:  2,
			},
			want: 12,
		},
		{
			args: args{
				values:     []int{9, 8, 8, 7, 6},
				labels:     []int{0, 0, 0, 1, 1},
				num_wanted: 3,
				use_limit:  1,
			},
			want: 16,
		},
		{
			args: args{
				values:     []int{9, 8, 8, 7, 6},
				labels:     []int{0, 0, 0, 1, 1},
				num_wanted: 3,
				use_limit:  2,
			},
			want: 24,
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			if got := largestValsFromLabels(tt.args.values, tt.args.labels, tt.args.num_wanted, tt.args.use_limit); got != tt.want {
				t.Errorf("largestValsFromLabels() = %v, want %v", got, tt.want)
			}
		})
	}
}

